import React from 'react'; 
import './PromotionPrompt.css';

const PromotionPrompt = ({onClick, color, from, to}) => {
	return (
		<div className='promotion_prompt'>
			<div className={`option q piece ${color}`} onClick={()=>onClick('q', from, to)} />
			<div className={`option n piece ${color}`}  onClick={()=>onClick('n', from, to)} />
			<div className={`option r piece ${color}`}  onClick={()=>onClick('r', from, to)} />
			<div className={`option b piece ${color}`} onClick={()=>onClick('b', from, to)} />
		</div>
	);
}
export default PromotionPrompt;
